class Solution(object):
	def findMaxAverage(self, nums, k):
		"""
		:type nums: List[int]
		:type k: int
		:rtype: float
		"""
		n = len(nums)
		if n < k:
			return
		max_num = 0
		for i in range(0,n-k+1):
			max_num = max(sum(nums[i:i+k]),max_num)
		print(max_num)
		return max_num/k

	def findMaxAverage1(self, nums, k):
		n = len(nums)
		res = [nums[0]]
		for i in range(1,n):
			res.append(res[-1]+nums[i])
		max_num = res[k-1]
		# print(n,len(res))
		# print(res)
		# print(max_num)
		for i in range(k,n):
			# print(i)
			max_num = max(res[i]-res[i-k],max_num)
			# print(max_num)
		return max_num/k

